import { useState } from "react"

function UseCallMuti(a:number, b:number){

    const [_a, setA] = useState<number>(a);
    const [_b, setB] = useState<number>(b);

    const callMulti = (_a,_b) => {
        console.log(`${_a}:${_b}`)
        return a*b
    }

    return callMulti
}

export default UseCallMuti
